import { Component, OnInit } from '@angular/core';
import { FormControl, FormGroup } from '@angular/forms';
import { HttpClient ,HttpHeaders} from '@angular/common/http';
@Component({
  selector: 'app-manager-profile',
  templateUrl: './manager-profile.component.html',
  styleUrls: ['./manager-profile.component.css']
})
export class ManagerProfileComponent implements OnInit{

  profileForm: FormGroup;
  constructor()
  ngOnInit(): void {

  this.profileForm=  new FormGroup({
  firstName: new FormControl[''],
  lastName: new FormControl[''],
  email: new FormControl[''],
  department_name: new FormControl[''],
  address: new FormControl[''],
  gender: new FormControl[''],
  phone_no: new FormControl[''],
  skillId: new FormControl[''],
  })

  }

  formData = {
    firstNamePlaceholder: '',
    lastNamePlaceholder: '',
    emailPlaceholder: JSON.parse(sessionStorage.getItem('key')).email,
    phoneNumberPlaceholder: '',
    departmentPlaceholder: '',

  };
  onSubmit() {

  }

  addSkill(){
    let skillbody ={
      "name": this.profileForm.value.skillname
 };
 this.http.post('http://localhost:8081/api/skill/add',skillbody).subscribe((data)=>{
  console.log(data);
  sessionStorage.setItem('skillkey',JSON.stringify(data));
  this.mySet.add( JSON.parse(sessionStorage.getItem('skillkey')).id);
  this.skillIdArray = Array.from(this.mySet);
 })
 console.log("the skill is added");
  }
}

<div  class="container" >
  <form [formGroup]="profileForm" (ngSubmit)="onSubmit()">
    <div class="form-container">
      <div class="nam">
      <div class="name-content2">
      <label>Email:</label>
        <input type="email" formControlName="email" placeholder="email" [value]="formData.emailPlaceholder">
      </div>

      <div class="name-content1">
        <label for="department">Department:</label>
        <input type="text" id="department" formControlName="department" placeholder="department">
      </div>
      </div>



      <div class="name-content">
      <label for="phoneNumber">Phone Number:</label>
      <input type="text" id="phoneNumber" formControlName="phoneNumber" placeholder="phoneNumber">
      </div>


        <div class="gender-radio">
          <div class="radio-options">
            <label><input type="radio" formControlName="gender" value="male">Male</label>
            <label><input type="radio" formControlName="gender" value="female">Female</label>
            <label><input type="radio" formControlName="gender" value="other">Other</label>
          </div>
        </div>

        <div>
          <label>Address:</label>
          <input type="text" placeholder="Address" formControlName="address">
        </div>

        <div class="add-skill">
          <label>Enter Skill Name</label>
          <br>
          <input type="text" formControlName="skillname"  placeholder="Enter skill name">
          <button (click)="addSkill()">Add Skill</button>
        </div>



    <button type="submit" >Create Profile</button>
    </div>
  </form>
</div>
